"title": "Titanium Wood Ring Lined With Whiskey Barrel White Oak Stave",
"description": "This ring also comes in Cobalt, which is more scratch resistant and the color of white gold:\n\nhttps://www.etsy.com/listing/197327996/cobalt-wooden-ring-lined-with-jack\n\nThe inner liner of this ring is made from a genuine used Jack Daniels Whiskey white oak barrel. Almost as much work goes into perfecting the Jack Daniels barrel as does perfecting the iconic American whiskey. Carefully selected American White Oak is slowly dried outdoors for nearly a year. After being exposed to the rain and sun, it is kiln dried, assembled, and then charred to release the naturally occurring flavors that will be imparted to the whiskey. Though the blanks reek of whiskey, the final products (sadly, from an authenticity perspective) have no odor, having been sealed with finish.  \n\nI have a few other barrel wood options besides Jack Daniels, including Jim Beam, Maker&#39;s Mark, and Buffalo Trace. Please see this blog post to see what I mean:\n\nhttp://www.wedgewoodrings.com/blog/2014/4/27/barrel-staves-and-the-many-options-at-our-disposal\n\nJACK DANIEL&#39;S is a registered trademark and is not involved in or affiliated with the production or distribution of this product!\n\nThe titanium in this wooden ring is 6al-4v grade 5 titanium, preferred among jewelers. The ring pictured is a stone finish, but satin and polished finishes are also available (message for details). \n\nTitanium ring sizes run from 4 to 16 including quarter sizes. I highly recommend going to a jewelry counter to determine your size, even if you already know your size.  &quot;Do it yourself&quot; ring sizing methods (string, etc.) should absolutely not be trusted. Be sure to be measured using the width you plan to order.  Include a custom finish/profile in the &quot;note to wedgewoodrings&quot; section at checkout.\n\n+++SEE SHOP ANNOUNCEMENTS ON THE SHOP PAGE FOR CURRENT SHIP DATE+++\n\nNOTE ON WIDTH:\n\nThe minimum width for this style is 5mm.  The maximum is 8mm.\n\nRecommended width is calculated in this way: Size 5 is 5mm wide. Width increases .5mm per size above that. So:\n\nSize 5- 5mm\nSize 7- 6mm\nSize 9- 7mm\nSize 11+- 8mm\n\n************************************ IMPORTANT INFO ****************************************\n\n****************************************************************************************************\n****PLEASE PLEASE PLEASE BE 100% SURE OF YOUR SIZE BEFORE ORDERING *****\n****************************************************************************************************\n\nTitanium lined wood rings cannot be resized at all! Every ring is made to the exact size provided. An error in sizing that exceeds the margin provided above will necessitate a completely new ring. Refunds and exchanges will not be possible.\n\nPlease click on the &quot;Policies&quot; link (under Shop Info) to see wood ring care instructions and FAQ.\n\nEach ring is given multiple coats of a hybrid epoxy finish, which is completely water-proof and soap proof. This protective coating is sanded up to 12,000 grit for an unbelievable, glass-like finish.\n\nAll rings ship via USPS Priority (or Priority International) Small Flat Rate Box. If you are outside the US and Canada, your only shipping option is Global Express.  Please read below for details.  Insurance is mandatory for this ring, and included in the shipping charge. You pay what I pay for shipping, nothing more.\n\nFor customers outside the US:\n\nDue to changes in USPS policy, international packages sent to countries other than Canada can no longer be tracked past the US border.  Insurance claims are also not possible.  Due to this change and for your protection, international customers outside of Canada will be required to pay for USPS Global Express shipping ($44.95), which in addition to guaranteeing arrival within 3-5 business days (excepting intervention from your country’s customs department), also can be tracked and insured.  I wish I could offer a more economical solution, but cheaper options are too risky.\n\nInternational customers are responsible for all fees associated with shipping to their respective countries. Orders that are shipped to countries outside of the United States may be subject to import taxes, customs duties and fees levied by the destination country. The recipient of an international shipment may be subject to such import taxes, customs duties and fees, which are levied once a shipment reaches your country. Additional charges for customs clearance must be borne by the recipient; I have no control over these charges and cannot predict what they may be. Customs policies vary widely from country to country; you should contact your local customs office for further information. When customs clearance procedures are required, it can cause delays beyond the original delivery estimates. It is against the law and I will not mark an item as a &quot;gift&quot; to avoid any fees.",
