"accepts_custom_requests": false,
"policy_welcome": "Hey everyone!  Thanks for stopping by!  I hope you find something here that you love. I use only the highest quality materials in my designs which I hope you will find to be fresh, simple and modern.   Feel free to contact me if you have any questions, or need something custom designed or altered to your specifications!",
"policy_payment": "Denise Topkis Designs accepts payments through PayPal. You do not need a PayPal Account to pay for your items through PayPal:\r\n\r\nYou can choose the PayPal Option during checkout. After you submit your order click the &quot;Pay Now&quot; button. Scroll Down and you will see the option to pay with a Credit or Debit Card WITHOUT having to sign up for a PayPal account.\r\n\r\nPackages will NOT be sent until the payment has been received. Customers are obliged to pay within three days of placing the order.  If payment has not been received on the third day, the transaction will be cancelled. \r\n\r\nIf you are new to Etsy or to Paypal, check out these helpful links. Please feel free to Email me with any questions! I&#39;d love to help you!\r\n\r\nhttp://www.etsy.com/help_guide_checkout.php\r\n\r\nhttp://www.etsy.com/storque/how-to/how-to-pay-with-a-credit-card-and-create-a-paypal-account-746/\r\n\r\nPlease note that California resident will be charged a 8.25% sales tax.\r\n\r\n*** There are custom duty taxes that will be imposed on top of your purchase, which you will be responsible to pay for. We are not in any responsible for custom duty taxes, so be aware of this before making a purchase as we will not refund you because of it.\r\n\r\nIf you are having issues with PayPal or any other aspect of the transaction, please do not hesitate to contact us. We will work with you to accommodate your needs.\r\n",
"policy_shipping": "All orders will ship within 3-5 business days from the date of payment. All packages will be sent via USPS. When shipping overseas, customs can delay packages by up to 6 weeks. This doesn&#39;t happen often, but it can happen.\r\n\r\nAll orders are sent via standard mail, unless noted otherwise. Notify the seller prior to making the purchase, if priority or first class mail is preferred.\r\n\r\nIf the shipping address is different from the address provided through Etsy or PayPal, please contact the seller prior to payment. If the Etsy and PayPal addresses are different, and no special instruction has been provided, Denise Topkis Designs will send the order to the address provided through Etsy.\r\n\r\nI ship anywhere in the United States and abroad, orders are shipped via USPS unless otherwise stated or arranged. If you feel that you would prefer to have insurance on the package, I can provide it but at the buyer&#39;s cost. Please contact me after the purchase is made and I will set up a separate listing for just the insurance cost so that the buyer can purchase it. US: Orders over $100 are insured for free.\r\n\r\nShipping abroad, any customs fees, taxes, or tariffs that may by incurred at the time of delivery are at the discretion of individual countries and are payable by the buyer.\r\n\r\n If you would like to upgrade to USPS Priority Mail, please notify me during check-out. I will send you an invoice through PayPal for the change in shipping cost. Please refer to the USPS.com website for up-to-date cost and the approximate days it will take for you to receive your package usually within 2-5 business days, excluding Sundays and Holidays. As always, feel free to contact me if you have any questions. \r\n\r\nMy mailing zip code is: 10573, this will give you a more accurate idea which shipping method works best for you or your needs.\r\n\r\nHere is the link to the USPS website for further inquiries:\r\n\r\nhttps://www.usps.com/\r\n\r\n\r\n\r\n",
"policy_refunds": "IF for ANY reason the pieces you bought do not meet your expectations, let me know, I will work with you to make it right! \r\n\r\nIf you have an item that needs repair ,(after use), you can mail the item to me for free repair. I will mail the item back to you at no charge.\r\n\r\nI want to be sure that you are fully satisfied with your purchase, therefore I accept returns for a full refund, less any shipping costs,  within seven days of receiving the item. Items must be returned undamaged with the original packaging, and related shipping documents.  Shipping and handling charges are non-refundable for returns or size adjustments. You may want to insure your return, as I cannot be responsible for lost returns. A credit will be issued through PayPal and will appear on your online account statement.",
"policy_additional": "If you&#39;re purchasing a Denise Topkis Designs item as a gift, special packaging and a hand written note can be included at no extra cost. Please use the &quot;contact the seller&quot; link at the bottom of the page to inform us of the occasion, shipping address, and personal message to be included in the package\r\n",
