"description": "These barrels are unlike anything you have ever seen before! These are completely customizable.  Select your size, finish, hoop style and personalize!  Add optional cleaning and/ or storing kits if you plan to use to make your own spirits often.  See matching accessories in our shop! (some are shown above)  SALE ON 1 LITER SIZE! NEED A 10 OR 20 LITER OR HOW ABOUT A 20 GALLON?  WE HAVE THEM TOO!  Ordering Internationally? We ship worldwide!  Since shipping costs vary depending on size and location, All International orders must request a shipping quote prior to submitting your order.\n\n✩Stand, Bung and Spigot are included.✩\n\n☞TO CUSTOMIZE YOUR BARREL, WE NEED THE FOLLOWING INFORMATION☟\n❶ Size (Select from drop down menu)\n❷ Finish (Select from drop down menu)\n❸ Hoop Style (Choose One: Black or Steel)\n❹ Personalization:\n~NAME\n~DISTILLERY\n~CITY/STATE\n~EST. YEAR\n\n✪✪✪✪  OPTIONAL  ✪✪✪✪\n❺ YOU CAN ADD A CLEANING KIT HERE:  https://www.etsy.com/listing/169199812/care-and-cleaning-kits-for-your-custom?ref=shop_home_active&ga_search_query=CLEANING\n\n✪ Please be sure to provide ALL information you would like for us to create your custom barrel.  If we do not receive all necessary information to create your custom barrel, we will make an attempt to contact you.  If you cannot be reached, we will create your barrel with the information provided.  If you did not specify a hoop style, we will select.  If no finish is noted, we will send unfinished.  Please be sure to include all info~ we really want you to love your custom barrel!\n\n☎ Have Questions or need help creating your custom barrel?  Feel free to contact us and we will be happy to assist you.\n\nP5",
