"vacation_message": "We are currently updating our shop designs and products.  You may still contact us by sending us a message and may continue to place your orders at www.customsentiments.com.\r\n\r\nThank you for your patience.",
"sale_message": "Thank you for your purchase from our Etsy Shop, BootlegBarrels, a division of www.customsentiments.com.  Leave us your feedback to receive a special coupon code to use toward your next purchase!\r\n\r\nPLEASE BE SURE TO CHECK OUR SHOP BANNER DURING THE HOLIDAYS!\r\nPlease be sure to read our shop banner regarding production times and Holiday closings if ordering around a Holiday.  We post all current production times in our banner since it is not easy to change every listing on Etsy just for the Holidays and during peak times.  \r\n\r\nCHANGES:\r\nPlease be sure to enter your personalization exactly as you want it personalized.  No changes can be made after submitting your order.  If you email us immediately we may be able to assist you but cannot guarantee it.  This Etsy shop is now connected to our main website so all orders received are directly sent to our primary site and it can literally take hours during this busy time of year to find an order so it is very important that all info is entered as you want it during checkout.\r\n\r\nRUSH OPTIONS:\r\nPlease be sure to contact us prior to placing an order if you need a barrel by a specific date and we will provide you with a rush shipping quote.  If you do not contact us prior, we cannot guarantee your order will arrive by the date needed.  Requesting we rush your order in the note to seller area during checkout will not rush your order.  All orders are produced in the order received in order to be fair to all customers since about 85% of people ordering have a date they need their order by.  Only a rush production will rush production of your order and rush shipping will rush the shipping speed of your order.\r\n\r\nCOUPON CODES:\r\nSimply leave feedback and we would be happy to send you a coupon code good for a future order as a BIG Thank You :)  Coupon codes are sent mat the end of each month for feedback left the prior month and expire within 30 days of receiving.  \r\n\r\nCANCELLATIONS:\r\nWe do have a no cancellation policy, but if you would like to request to cancel an order you can request by emailing cancellations@customsentiments.com for fastest service.  Be sure to enter your Etsy order# in the subject of the email.  There is a cancellation fee for every cancellation honored and no cancellation will be honored 12 hours after an order has been placed-no exceptions.  This is stated in our shop banner, as well as our policy page and we make all our information and cutoffs readily accessible.  We apologize for any inconvenience. \r\n\r\n☎ Feel free to contact us and we will be happy to assist you.  Please message me directly on Etsy for questions regarding your order or email me at steve.barrels@customsentiments.com.  \r\n\r\nWe hope you love your custom barrels and barrel products and wish you Happy 2015!  \r\n\r\nCheers!",
