"title": "Gifts & Personalized Creations",
"announcement": "****Our current production time is 3 weeks****\r\nIf you need your order sooner, please message us before ordering. Thanks!\r\n\r\nWelcome to our shop! Please convo us if you have any questions about any of our items. We specialize in custom orders so feel free let us know if there is something you are looking for that you don&#39;t see in our shop. If you live in Hampton Roads and would like to pick up your item just convo us so we can create a custom listing with no shipping charges. Visit our policies page for additional information. Thanks for stopping by!\r\n\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "****PLEASE READ****  The shop will be closed for a few days. During this time all open orders will still ship as scheduled with our regular 3 week production time and if we already discussed rushing your order, it will still arrive by your requested date. We will continue to check messages periodically but responses may not be as quick as usual. Thank you! =) See y&#39;all when we get back! \r\n",
"sale_message": "Thank you for your order! As stated in our shop, our current production time is 3 weeks. We will review your order details and contact you if we need any further information. Let us know if you have any questions or need any assistance. Please note, all communications should be made through Etsy convos. We get hundreds of emails crowding our inbox so this is nessarcary for prompt response time. Feedback is always appreciated. We love to see your photos! Follow @anchoravenuedesigns on Instagram and share! ",
"digital_sale_message": null,
"last_updated_tsz": 1432234501,
"listing_active_count": 169,
"login_name": "anchoravenuedesigns",
"accepts_custom_requests": false,
"policy_welcome": "Hi, welcome to Anchor Avenue Designs..our little corner of the Etsy world!  In our shop we feature glassware embellished with vinyl. Our items make great gifts for wedding parties, birthdays, holidays, or any other special event. Take a look around our shop and visit our policy page for more information. Thanks for stopping by!",
"policy_payment": "Payments can be made through Etsy direct checkout or through PayPal only. \r\n-----------\r\nWe offer discounts for large orders. To get the discount you must convo us BEFORE  purchasing with the items you would like. We will make you a custom listing at the discounted price. \r\n\r\nDiscounted Rates for large orders are as follows:\r\n(The following discounts do not apply to sunglasses, shot glasses, or stadium cups and are not applicable on rush orders.)\r\n            {1-7}    price as listed\r\n            {8-15}    $1 off each item\r\n        {16+}    $1.50 off each item\r\nThe above discounts apply to mugs, tumblers, flasks, and wine/beer/pint glasses.",
"policy_shipping": "Please see our shop announcement for our current production time. For orders with 10 items or more, please allow an additional week for production. This does not include shipping time which is an additional 2-3 business days. We ship USPS 1st class and priority mail. Rush orders are available for an additional charge of $5 per item. Production time on rush orders is 1-2 business days. \r\n------------\r\nIf you are in the Virginia Beach/Hampton Roads area you can pick up your items to avoid shipping time and costs. \r\n---------\r\nIf you need international shipping please message us first with where you are located. We will calculate shipping and create a custom listing for you. ",
"policy_refunds": "We take great pride in our work. If you have any issues with your order please let us know right away. Please do not use the Etsy feedback section to make complaints about your order unless you speak with us through Etsy convos first. We can assure you we will work with you to remedy any situation that may arise. \r\n-------------\r\nBecause our items are made to order, we do not offer refunds. We will offer corrections or replacements on items that may need them. When ordering, please be sure to check spelling carefully on any customizations. Items with dates will have the same layout unless specifically requested otherwise. This will be MM.DD.YY by default. If you would like something different please leave a note along with the date stating you would like it exactly as you type it. As stated above, please contact us upon receipt of your order if there are any issues. Any issues should be brought to our attention within 2 days of delivery, including items damaged during shipping. It is the buyers responsibility to double check correct spelling, shipping addresses, etc. \r\n-------------\r\nWe will offer one replacement for DIY decals at no charge for the item. Shipping costs are the responsibility of the buyer. Please read the application instructions carefully before applying your decal to its new surface. Please note, this applies to decals we have listed in our shop. This does not apply to customers that request just the decal for one of our already made item listings. ",
"policy_additional": "We will be happy to do custom designs for you. Convo us with details of what you are looking for. Please note, because these designs are extremely time consuming, we will not begin work on a custom design until it is paid for. We will create a custom listing in our shop with your name on it for you to purchase. This only applies to orders that are not listed in our shop or that contain many modifications on an item listed in our shop. \r\n-----------\r\nWe use high quality outdoor grade vinyl. All items are waterproof and handwash only. For longest life, vinyl should not be soaked or scrubbed. Our Coral, Pale Pink, and Glitter options are indoor grade vinyl. Due to customer requests and popularity of these options, we will continue to carry them. Items using these colors are still waterproof. Extra care should be used when washing. If at any point these colors become available in an outdoor vinyl, we will begin to carry that option instead. ",
"policy_seller_info": "For prompt response time, contact must be made through Etsy convos. Our regular email account is flooded with emails from suppliers so we cannot guarantee we will see your message if sent there. ",
"policy_updated_tsz": 1430094973,
"vacation_autoreply": "*automated response* \r\n\r\nHi there, thanks for shopping with us! As of 5/12 we are in vacation mode so that we can catch up on orders. Please rest assured, orders that have already been placed will be shipping in time as promised. If we already discussed rushing your order it will still arrive by the date we agreed upon. We will continue to check and respond to your messages periodically but replies may not be as quick as usual. Thank you! \r\n\r\n-Amanda\r\nAnchor Avenue Designs",
