"announcement": "LEAD TIME IS CURRENTLY 5 WEEKS.  Cobalt wood rings / Zirconium wooden rings can be rushed 21 days - $55) Titanium and wood rings can be rushed (15 days - $55) Hand-wrought damascus styles ($475) are sold in very limited quantities per month and cannot be rushed!\r\n\r\nNotable Rings:\r\n\r\nhttp://www.wedgewoodrings.com/notable-rings/\r\n\r\nPre-made, ready to ship rings are available here:\r\n\r\nwww.etsy.com/shop/WedgewoodTurnings\r\n\r\nHere is a list of available styles and prices (though this does not show the many dozens of wood options)- far too many to picture):\r\n\r\nhttp://wedgewoodrings.wordpress.com/2011/11/15/no-time-for-blogging/\r\n\r\n\r\n-------------------\r\n\r\nDue to changes in USPS policy, international packages sent to countries other than Canada can no longer be tracked past the US border.  Insurance claims are also not possible.  Due to this change and for your protection, international customers outside of Canada will be required to pay for USPS Global Express shipping, which in addition to guaranteeing arrival within 3-5 business days (excepting intervention from your country’s customs department), also can be tracked and insured.  I wish I could offer a more economical solution, but cheaper options are too risky.\r\n\r\n--------------------\r\n\r\nWe love the simplicity and beauty of natural wood rings. All WedgeWood Rings are handcrafted, sanded, and polished using wood that is carefully selected specifically for making rings.  Each wooden ring is sized, made-to-order and unique. WedgeWood Rings are made of recycled woods or purchased from eco-conscious sellers. All rings are given multiple coats of a clear, durable finish to ensure the ring remains structurally sound and beautiful with minimal care on the part of the wearer. \r\n\r\nWedgeWood Rings get its name from the location of the original humble workshop: the basement of a house located in the South Wedge neighborhood of Rochester, NY.\r\n\r\nThanks for looking!\r\n\r\nWedgeWood Rings now has a blog! See whats new in the shop, get a preview of new  woods, and see previously shipped orders.  \r\n\r\nhttp://www.wedgewoodrings.com/",
