"description": "Rare Antique Schenectady, New York Drug Store Pharmacy PROHIBITION Rye Whiskey PRESCRIPTION, Medical Alcohol 1 Pint  of Rye on 9/24/1932  for Mr. Anthony Fazio...... \r\n\r\nHere&#39;s an authentic National Prohibition Whiskey Prescription Form. This Duplicate pink form was supposed to be retained by the Druggist as a permanent record, and open to inspection by federal officers...This was printed by Treasury Department U.S. Internal Revenue, Bureau of Industrial Alcohol, and is a Prescription Blank by the National Prohibition Act as printed at bottom of Rx and on sides... \r\n\r\nWhen you hold this up to the light (pic #3) you can see &quot;PROHIBITION&quot; printed, watermarked in the paper, and the Treasury Seal in Latin in the center, and informative instructions on back... .... \r\n\r\nThe Medicine prescription is written for 1 PINT of Rye (WHISKEY), and directions are or looks like 1 oz. EVERY 5 HRS.....  (in Pharmaceutical Lingo)....This was a way of getting whiskey, liquor, during the prohibition days by having your Doctor prescribe it for medicinal purposes... (Dr. Frank ?? in this one)\r\n \r\nThe Rx was prescribed on September 22, 1932 and it&#39;s written for or looks like Mr. Anthony Fazio,  1240 7th Ave., Schenectady, NY....This was filled by Henry Kerst  in Schenectady, New York.. \r\n\r\nThe Rx measures 5 1/2&quot; x 4 1/2&quot; and in good shape for its&#39; age, just crease or fold marks...... \r\n\r\nA nice addition to your apothecary, Stamp, Genealogy, pharmacopeia, alcoholics anonymous collection, Roaring 20&#39;s, Al Capone collection, Art Deco barware, Speakeasy, bootleg, Office, Kitchen, Bar, liquor control board, Internal Revenue, Wine, Whiskey, Beer, etc..etc...... \r\n\r\nAlso a great Graduation, Christmas, birthday gift to a Pharmacy medicine College Student, Pharmacist, Druggist, Nurse, Doctor, bartender,  etc....... \r\n\r\nWe do combine on shipping... International buyers please email for ship cost..",
