"description": "A truly personal gift for the whiskey lover in your life, or the perfect way to celebrate good times and smooth spirits in your own home. Our exclusive personalized bar signs are cut in a classic shape with a high-gloss finish, and measure 10.75&quot; x 15.5&quot; x .25&quot;.\n\n:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\nWHEN WILL MY PERSONALIZED ITEM SHIP:\n:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\nAll items are stocked and personalized one at a time in Oklahoma City, OK. After your order is placed, it typically takes 1-2 business days to ship out (3 days during holidays). Depending on where you live, it then typically takes an additional 4-5 days for the item to arrive. (please allow an extra 4-5 days for Alaska, Hawaii, and Puerto Rico)\n\n\n:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\nHOW TO ORDER PERSONALIZED ITEMS:\n:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\nA) Please select your item and add it to the cart\nB) Please INCLUDE IN THE CHECKOUT NOTES:\n1) Name (ex: Richard&#39;s)\n2) Year\n\n*** Note: The item will be personalized engraved in the font shown. The more text you put the smaller the engraving will have to be to fit the object. Flasks are limited to 2-3 lines, all other items are limited to the personalization areas shown. We will make all efforts to fit your personalization, but please keep it reasonable, no special characters or emoticons please. As a general rule, if it&#39;s not on your keyboard, we cannot print it. Enter your personalization EXACTLY as it should to engraved. We will engrave letters in the same order you list them in. ***\n\nAll artwork, designs, and photos Copyright © HomeWetBar.com",
