"title": "Vintage Pharmacy Prohibition Whiskey Prescription Medical Alcohol Bar Rx 1/8/1927 Easton Pennsylvania History Dr. Raub",
"description": "Vintage Original Antique 1927 Easton, Pennsylvania Drug Store Alcohol PROHIBITION Whiskey PRESCRIPTION on 1/8/1927 for Medicinal Alcohol, for  L. Cohen ....(Lillian Cohen)\r\n\r\nHere&#39;s an Original prescribed Pharmacy Prohibition Whiskey Prescription. This was printed by Treasury Department U.S. Internal Revenue and is a Prescription Blank by the National Prohibition Act as printed at top of Rx. \r\nWhen you hold this up to the light (pic#3) you can see &quot;PROHIBITION&quot;  printed, watermarked in the paper, and punched VOID....Take notice of the beautiful graphics, poppy&#39;s and spider web graphics, at the corners and edges, and Medical seal in Latin in the center.\r\n\r\nThe Antique prescription is Prescribed for 16 oz. of  SPTS. FRUMENTI, which is the Latin term for WHISKEY, and directions are AS DIRECTED....This was a way of getting whiskey, liquor, alcohol, during the prohibition years by having your Doctor prescribe it for medicinal purposes. (Dr. Raub in this one)\r\n\r\nThe Rx is hand written with a pen, and dated January 8, 1927 and Prescribed for L. Cohen, 23 S. 9th St., Easton, Pa....   \r\n(According to my 1927 Easton Directory The person at this address was Lillian Cohen, and worked as a stenographer during this time)\r\n\r\nThe Rx measures 6 3/4&quot; x 6&quot; , has slight crease mark, and paper clip indent mark, otherwise in good shape for its&#39; age...\r\n\r\nA nice addition to your Apothecary, Pharmacopeia, Roaring 20&#39;s, Al Capone collection, Art Deco Bar, Barware, Saloon, Pharmacy, bootleg, History, etc.,\r\n Also a great Graduation, Christmas gift to a Pharmacist, Nurse, Doctor, Physician, Bartender, Medical student, Druggist, Distillery, etc......",
