"title": "Eclectic Antique & Vintage Items",
"announcement": "We really like Vintage and Antique items.... So, have a cup of tea, smell the Lilacs (which are in bloom right now), and browse through our Sun Porch of eclectic items..You may find something you can&#39;t live without.. :) ...Thanks for visiting!!",
