"login_name": "SunPorchOnLilacLane",
"accepts_custom_requests": false,
"policy_welcome": "Welcome to the Sun Porch with a view of the Lilacs. I&#39;m sure you know what they smell like, because they are intoxicating when in season....mmmmmm\r\nWe have an array of vintage items, and antiques, Some items are from us downsizing, and others from estate sales, clean outs, etc.. We&#39;ve been buying, selling, trading for over 25 years now at Antique shows, Flea markets, and online for 15 years.. We just like the feel and character of antique, vintage items...\r\nSo, check out our items, and hope you find a treasure.. :) ",
"policy_payment": "We accept payments, credit cards via Paypal  and or Etsy checkout only... Cash is accepted when picking up item.\r\nYou DO NOT need to have a Paypal account to use the system to pay with a credit card or e-check. Paypal acts as the credit card processor for all Etsy orders.\r\n",
