"title": "Limited Edition 15/40 Reclaimed Kentucky Atherton Distillery Cypress, Fountain Pen Comfort Grip",
"description": "This is a great looking pen and the comfort grip makes it very comfortable to write with. This is a great fountain pen for novice users as well as those who are experts with the nib! \n\nThe wood is cypress (pre-prohibition cypress wood) and it was used for the fermenting process of bourbon before it got put into the barrels. The wood came from a distillery called Atherton Distillery in Kentucky, started in 1867. \n\nWhile making this pen, I found it amazing to sense the smell of bourbon, the barrels held for so many years. Because the cypress vats held bourbon that was 40% alcohol, I will be making 40 items with the wood that I have. This listing is 15/40.\n\nI make each pen in my garage workshop. I also use a finishing technique that involves the use of boiled linseed oil and 10 coats of acrylic, to give it a very durable and water resistant layer.\n\nThis pen comes with a refillable reservoir that can be used with your own ink well. It also comes with one black ink cartridge, easily found at most office supply stores. This pen also comes packaged in a gift box, ready for gifting. \n\nInternational orders may take up to 2 weeks to arrive.\n\nThank you for checking out my listing and elevate your routine!\n-Aye",
