"policy_shipping": "Items typically ship within 1-2 business days (3 days during peak holidays) and transit normally takes 3-5 days via USPS and UPS ground. We ship all items out of Oklahoma City, OK",
"policy_refunds": "We will gladly replace any damaged items at our expense when reported within 15 days, so rest assured your item will arrive in great shape. However, due to the highly customized nature of the items we sell, regret we cannot accept returns on personalized items.",
"policy_additional": "Please contact us directly if you are interested in bulk or wholesale orders. We can add your event or company logo to most items.",
