"title": "Tea Stained and White Card Stock Tags",
"announcement": "Hope you find something you like!  when checking out....type the names/date you would like on your personalized tag in the NOTES TO SELLER area at checkout\r\nIf you would like a custom tag or a font change please, please, please ask before you place an order. Custom tags may require a design fee. \r\n\r\nFor the most part, how you write the date in the notes will be the way it appears on the tag, if you write November 11, 2016 it will be written out on the  tag ....I will not change it to 11.15.16 (even if it appears that way on the sample tag)",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Hi! I will be on vacation until Saturday",
"sale_message": "                  ´*•.¸(´*•.¸♥¸.•*´)¸.•*´\r\n                   ♥•.*thank you*.•♥\r\n\r\nIF YOU JUST ORDERED a personalized (not custom) tag...IF YOU DID NOT add the name and date you would like on your tag in the notes to seller area at check out, send me a quick etsy email letting me know what name/date you would like on the tag you purchased\r\n\r\nDear Customers, Please Please Please ask prior to ordering if you want the wording changed on the tags, it may require a custom tag charge.\r\nThank you for understanding\r\n\r\nYOUR SHIPPING ADDRESS: Please make sure your address is correct on ETSY, I use the shipping tools from the ETSY website\r\n\r\n\r\nMost items are custom made, which means that I do not have a large stock ready to ship items, but rather make them after receiving your order.  Custom Tags may require an additional fee unless agreed upon prior to purchasing.\r\n\r\nCurrently, I am completing orders within 3 -4 business days, which does not include weekends or holidays.  I work hard to send out completed items as soon as possible.\r\n\r\nPlease check your receipt under &quot;purchases & reviews&quot; in your &quot;account&quot; tab to find the date by which your item is schedule to be mailed out. I make every effort to complete items and mail them before that final estimated date.\r\n\r\nThe best way to make contact with me is via Etsy communications. I do not check my hotmail account often for communications.\r\n\r\nIf there is a problem with the item, or it is not what you expected, please contact me for a resolution, before posting a review. If you love your item, a positive feedback/review is greatly appreciated!\r\n\r\n\r\n",
