"login_name": "tiazoey",
"accepts_custom_requests": true,
"policy_welcome": "Welcome. My name is Traci.  I want to thank you for visiting my TiaZoey shop. Your satisfaction with your purchase and the transaction itself are important.\r\n\r\nPLEASE add the name and date you would like on your tag in the notes area at check out, tag links in the shop are to personalize, if you would like a custom tag or change the wording, contact me prior to purchasing.\r\n\r\nYOUR PERSONALIZED TAG INFO:  I use the copy paste method of adding information to the tags, if you write the month out...ex. November...I will write November not 11 on the tag...(except where the tag has initials then the number will be used)....\r\n\r\nNON-Smoking home...........\r\nItems are in a pet friendly home.... My cat and 2 dogs are a huge part of my life, I will try really hard to make sure all animal hair stays at my home , but in advance I am sorry if a spare animal hair makes it into your product or on the packaging,. so if you have allergies you may want to take this into consideration.  \r\n\r\nif purchasing handmade tags, please allow for 5 - 7 days to process before shipping, and remember first class takes 2-5 days after that....international order could take a couple weeks to a month depending on where you are located :)\r\n\r\n\r\nIf you have a few spare minutes, please visit my Mother&#39;s shop http://luruuniques.etsy.com. \r\nand my sisters shop\r\nhttp://thoselittlecharms.etsy.com\r\n\r\nThank you again for visiting my shop.",
"policy_payment": "International Buyers are responsible for any duty/tax/admin fees their country may have.\r\n\r\nOrders paid with E-Check through Paypal will not be shipped until payment clears through Paypal",
"policy_shipping": "My Shipping price is approximate, includes the actual mailing price and price for packaging materials.\r\n\r\nIf you are wanting to pay the cost of priority mail let me know before check out.\r\n\r\nYOUR SHIPPING ADDRESS: Please make sure your address is correct on ETSY,I use the shipping tools from the ETSY website, allows me to track the package without using multiple websites If the USPS suggests an alternate address I will use what they suggest....such as if you write Street West, post office may suggest ST W... \r\n\r\nItems will be insured at your cost if so desired. If I choose to insure it will be at my cost.\r\n\r\nIf purchasing handmade tags, please allow for 5 -7 days to process before shipping, and remember first class takes 2-5 days\r\n\r\nSorry, I can not  responsible  for late or lost packages once I have mail them.  I will try to help located them by contacting the post office, but PLEASE do your part by contacting your post office also\r\n\r\nIf I over estimate shipping charges , I will refund to your Pay Pal Account at your request if the difference in amount is larger than $3. If under $3 difference it is considered shipping/handling.  \r\n\r\nI am willing to ship internationally, just send a convo if your countrry is not included.\r\nInternational Buyers are responsible for any duty/tax/admin fees their country may have.   PLEASE REMEMBER INTERNATIONAL SHIPPING COULD TAKE UP TO A MONTH depending on where you are located and your delivery handlers policys\r\nI am not responsible for international items lost in the mail,  I will not send a refund or new items if  international item is lost in the mail, I will provide you with a tracking number, I will send a customs number showing it has been mailed and when it leaves the US, Sorry, but I cannot be responsible for the delivery system.\r\n\r\n",
"policy_refunds": "Please contact me. I want you to be happy with your purchase. \r\nI will not accept returns unless I have misrepresented an item.. I try to mention any imperfection that I can see.  I WILL NOT accept returns on custom or personalized items unless they have incorrect information on my part. Please make sure your spelling is correct.. I generally send you a photo proof of the item if is a one of a kind or custom project.  I try my best to be accurate in the measurements and descriptions.\r\n\r\nIf you need a more accurate description of color or anything, please convo me before purchasing\r\n\r\nUGLY SWEATERS: If you need a more accurate description of color or anything, please convo me before purchasing...I will not accept returns unless I have misrepresented an item..\r\nShipping not refunded, return shipping with tracking at buyers expense.  tracking number expected within 2 days for refund, sorry I am not a department store, please don&#39;t expect to wear the sweater to your event and then return for refund.",
"policy_additional": "International Buyers are responsible for any duty/tax/admin fees their country may have. \r\nRush orders are subject to $15 for rush fee and priority shipping rate...please ask first\r\n\r\n",
